    "full_text" : "他们把一切有趣的东西都抹杀了\n\n下东西得用迅雷、百度网盘\n\n聊天得用QQ、微信\n\n听歌得用网易\n\n全都得开会员，不开会员就得看广告、被限速、不让下载\n\n自由的网络呢？以前的海盗精神呢？不能看繁殖影像也就算了，连说句话都能被抓起来在黑色笼子里被暴打一顿。(身子弱的直接就嗝屁了",
