    "favorited" : false,
    "full_text" : "学中文专业有一个坏处\n学到精深后 脑子一堆中文术语\n然而写代码时只能很傻逼地写拼音\n\n所以造成了没人能看懂它写了什么的现象\n所以代码得不到传播，所以社会学术持续处于低水平",
    "lang" : "zh"
