    "created_at" : "Sat Oct 27 03:01:20 +0000 2018",
    "favorited" : false,
    "full_text" : "The biggest problem with the traditional teachers around the world is that they keep doing repeated work for a fixed monthly wage. \n\nClearly, you can record class once, then use it every day. \n\nThe results of repeated teaching are the teacher is tired, the students are tired too.",
    "lang" : "en",
