    "full_text" : "中国教育失败的关键在于：\n\n只重视监督学习，而忽略掉强化学习。\n\n事实是，监督学习只能让学生的能力等于或小于老师(现有资源)，而强化学习可以超越老师。\n\n但是强化学习者前期像傻逼，做什么事都要不断试错，所以极其容易被应试教育淘汰。\n\n几乎所有的自学成才的伟人都是强化学习者。",
