    "full_text" : "从过往的经历来看，但凡我不遵循这些简单的原则交的朋友，都不得善终。感觉挺伤心的，浪费了两个人宝贵的时间和精力。\n\n还弄得别人觉得自己很弱，很难受。要是一开始就不接触，情况会好很多。干嘛给自己和别人找罪受呢？",
